function () {
  let skills = profile_gpt_data.data.skillsAndLanguagesDTOList;
  let experiences = profile_gpt_data.data.experiences;
  let skillMap = new Map();
  skills.forEach(skill => {
    skillMap.set(skill.id, skill.name);
  });
  function mapSkillIdsToNames(experience) {
    let skillNames = experience.skillIds.map(skillId => {
      return skillMap.get(skillId);
    });
    return {
      id: experience.id,
      role: experience.role,
      company: experience.company,
      skillNames: skillNames,
      start: experience.start,
      end: experience.end,
      currentlyEmployed: experience.currentlyEmployed
    };
  }
  let mappedExperiences = experiences.map(experience => mapSkillIdsToNames(experience));
  return mappedExperiences;
}

